import "./App.css";
import { BrowserRouter, Route } from "react-router-dom";

function App() {
    return (
                <div className="App">
                  <BrowserRouter>

                    <header className="landing-header"></header>
                    <section className="container-one"></section>
                    <section className="container-two"></section>
                    <section className="container-three"></section>
                  </BrowserRouter>
                </div>
    );
}

export default App;
